import React, { Component } from 'react';

// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import Stars from "@material-ui/icons/Stars";
import Add from "@material-ui/icons/Add";
import GridItem from "../../components/shared/Grid/GridItem.js";
import GridContainer from "../../components/shared/Grid/GridContainer.js";
import Card from "../../components/shared/Card/Card.js";
import CardHeader from "../../components/shared/Card/CardHeader.js";
import CardBody from "../../components/shared/Card/CardBody.js";
import Table from "../../components/browser/ListFiles.js";
import Button from "../../components/shared/CustomButtons/Button.js";
import CustomInput from 'components/shared/CustomInput/CustomInput.js';

const util = require('util')

const styles = {
  cardCategoryWhite: {
    "&,& a,& a:hover,& a:focus": {
      color: "rgba(255,255,255,.62)",
      margin: "0",
      fontSize: "14px",
      marginTop: "0",
      marginBottom: "0"
    },
    "& a,& a:hover,& a:focus": {
      color: "#FFFFFF"
    }
  },
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontWeight: "300",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    textDecoration: "none",
    "& small": {
      color: "#777",
      fontSize: "65%",
      fontWeight: "400",
      lineHeight: "1"
    }
  }
};

const TableList = function (props) {
  const useStyles = makeStyles(styles);
  const classes = useStyles();

    return (
      <div>
        <GridContainer>
          <GridItem xs={12} sm={12} md={12}>
            <Card plain>
              <div style={{textAlign:'right'}}>
                <CustomInput
                  formControlProps={{
                    className: classes.margin + " " + classes.search
                  }}
                  inputProps={{
                    placeholder: "Folder Name",
                    inputProps: {
                      "aria-label": "Folder Name"
                    }
                  }}/>
                <Button style={{backgroundColor:'#ff9800'}} color="black" aria-label="edit" justIcon round
                  onClick={() => {
                    props.handleAddFolderClick = (handler) => {
                      handler();
                    }
                  }}
                >
                  <Add />
                </Button>
                <Button style={{backgroundColor:'#ff9800'}} color="black" aria-label="edit" justIcon round>
                  <Stars  />
                </Button>
              </div>
              <CardBody>
                <Table
                  tableHeaderColor="primary"
                  tableHead={["", "Name", "Last Changed", "Size (MBs)"]}
                  tableData={[]}
                  params={props.match.params}
                />
              </CardBody>
            </Card>
          </GridItem>
        </GridContainer>
      </div>
    );
  }

export default TableList;
